window.bookSummaryJSON = "<p>From the <i>New York Times</i> best-selling author of the Dave Riley Green Beret series. </p> <p>Maverick federal employee Sammy Pintella, obsessed with uncovering the fate of her MIA father, makes a startling discovery while rifling through some inactive government files. A dozen faded black-and-white photos seem to point to the existence of a secret US Military base built in the frozen wastelands of Antarctica during the height of the Cold War. </p> <p>Aided by Special Forces veteran Dave Riley, she heads for Antarctica. But they aren't alone. Spies, North Koreans and other shadowy forces are also en route, because deep inside Eternity Base is something people will go to extreme lengths to get: a cache of nuclear warheads.</p>"; 
